import React from "react";
import { useState,useEffect } from "react";

function Table(){
    const [list,setList]=useState([{
        "id":1,
        "firstName":"jebstin",
        "lastName":"raj",
        "gmail":"jebastinraj@gmail.com",
        "birthDay":16,
        "education":"BCA"
        
    }])

    return(
        <div>
       <Table>
        <thead>
            <th>Id</th>
            <th>First Name</th>
            <th>Last Name</th>
            <th>Location</th>
            <th>Gamil</th>
            <th>D.O.B</th>
            <th>Education</th>
            <th>Edit</th>
            <th>Delete</th>
        </thead>
        <tbody>
            {list.map((e,i)=>{
                return(
                    <tr>
                        <td>{e.id}</td>
                        <td>{e.firstName}</td>
                        <td>{e.lastName}</td>
                        <td>{e.location}</td>
                        <td>{e.gmail}</td>
                        <td>{e.brithDay}</td>
                        <td>{e.education}</td>
                        <td><button>Edit</button></td>
                        <td> <button>Delete</button></td>
                    </tr>
                )
            })}
        </tbody>
       </Table>
            
        </div>
    );
} export default Table;
